title:
  "Codeword Register."

introduction:
  "For reasons of customer confidentiality or commercial secrecy it is
   sometimes necessary to use codewords to obfuscate the identity of a
   counterparty or project. This list of words was originally developed
   by Oren Tirosh for mnemonic encoding of data, so each word is short,
   easy to remember and reasonably distinctive."

